// React
import React from "react";

// Third part
import { Table } from "antd";

const { Column } = Table;

const Tables = ({
  dataSource,
  colOne,
  colTwo,
  colThird,
  colFourth,
  colFive
}) => {
  return (
    <Table dataSource={dataSource}>
      <Column title={colOne} />
      <Column title={colTwo} />
      <Column title={colThird} />
      <Column title={colThird} />
      <Column title={colFourth} />
      <Column title={colFive}></Column>
    </Table>
  );
};

export default Tables;
